import React from 'react'

const Priority = ({priority}) => {
    return (
        <>
            <span>{priority}</span>
        </>
    )
}


const IssueElement = (props) => {
    return (
        <>
            <div style={{"cursor":"pointer","paddingTop":"9px","paddingLeft":"9px","marginTop":"21px","backgroundColor":"#000000","color":"#FFFFFF","border":"1px solid white","borderRadius":"9px"}} >
                <Priority priority={props.priority}/>
            </div>
        </>
    )
}

export default IssueElement
